riable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n\n    let index = source.data['index'],\n        i = Math.max(_bt_bin_search(index, cb_obj.start) - 1, 0),\n        j = Math.min(_bt_bin_search(index, cb_obj.end) + 1, index.length);\n\n    _bt_scale_range(\n        ohlc_range,\n        source.data['ohlc_high'].slice(i, j),\n        source.data['ohlc_low'].slice(i, j));\n    try {\n        _bt_scale_range(\n            volume_range,\n            source.data['Volume'].slice(i, j),\n            0);\n    } catch (e) {}  // volume_range may be undefined\n\n}, 50);\n"},"id":"1319","type":"CustomJS"},{"attributes":{"source":{"id":"1224","type":"ColumnDataSource"}},"id":"1235","type":"CDSView"},{"attributes":{"bottom":{"field":"Close"},"fill_alpha":{"value":0.1},"fill_color":{"value":"#1f77b4"},"line_alpha":{"value":0.1},"line_color":{"value":"#1f77b4"},"top":{"field":"Open"},"width":{"field":"_width"},"x":{"field":"index"}},"id":"1233","type":"VBar"},{"attributes":{"line_color":"#ff7f0e","line_width":1.3,"x":{"field":"index"},"y":{"field":"SMA(C,40)_0"}},"id":"1282","type":"Line"},{"attributes":{"data_source":{"id":"1224","type":"ColumnDataSource"},"glyph":{"id":"1232","type":"VBar"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"1233","type":"VBar"},"selection_glyph":null,"view":{"id":"1235","type":"CDSView"}},"id":"1234","type":"GlyphRenderer"},{"attributes":{"toolbar":{"id":"1367","type":"ProxyToolbar"}},"id":"1368","type":"ToolbarBox"},{"attributes":{"label":{"value":"Peak (102%)"},"renderers":[{"id":"1098","type":"GlyphRenderer"}]},"id":"1111","type":"LegendItem"},{"attributes":{"data_source":{"id":"1095","type":"ColumnDataSource"},"glyph":{"id":"1096","type":"Scatter"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"1097","type":"Scatter"},"selection_glyph":null,"view":{"id":"1099","type":"CDSView"}},"id":"1098","type":"GlyphRenderer"},{"attributes":{},"id":"1024","type":"RedoTool
